import React, {useEffect, useState} from "react";
import {useDispatch, useSelector} from "react-redux";
import {Link} from "react-router-dom";
import axios from "axios";
import PaypalButton from "./PaypalButton";

function OrderDetail(props) {
    const {userInfo} = useSelector(state => state.user)
    const [order, setOrder] = useState({});
    const [items, setItems] = useState([]);

    const itemsHtml = [...items].map(item => {
        // return <tr key={item._id}>
        //         <th scope="row">
        //             <Link to={"/products/" + item._id}>
        //                 <img src={"/images/" + item.image} alt="" style={{height: "100px", width: "auto"}}/>
        //             </Link>
        //         </th>
        //         <td>
        //             <Link to={"/products/" + item._id}>
        //                 {item.name}
        //             </Link>
        //         </td>
        //         <td>${item.price}</td>
        //         {/*<td>{item.qty}</td>*/}
        //         {/*<td>${item.price * item.qty}</td>*/}
        //     </tr>
        return <tr>
            weqwe
        </tr>
    })

    const calculateTotal = () => {
        let total = 0;

        items.forEach((item) => {
            total += item.qty * item.price;
        })

        return total;
    }

    useEffect(()=>{
        if(!userInfo){
            props.history.push("/")
            return
        }

        const fetchOrderAndItems = async () => {
            const order = await axios.get("/api/orders/" + props.match.params.id, {
                headers:{
                    authorization: "Bearer " + userInfo.token
                }
            });
            const order_data = order.data
            setOrder(order_data)

            let items_array = [];
            order_data.orderItems.forEach( async (orderItem) => {
                const {data} = await axios.get("/api/products/" + orderItem.productId);
                items_array.push(data);
            })
            setItems(items_array);
        }

        fetchOrderAndItems();
    }, [userInfo]);

    return <div className="container mt-4">
        <div className="row">
            <div className="col-8">
                <div className="card mt-4">
                    <div className="card-header">
                        Shipping Address
                    </div>
                    <div className="card-body">
                        {
                            order.shipping ?
                                <p className="card-text">{order.shipping.address}, {order.shipping.city}, {order.shipping.postal}, {order.shipping.country}</p>
                            : null
                        }
                    </div>
                </div>

                <div className="card mt-4">
                    <div className="card-header">
                        Payment Method
                    </div>
                    <div className="card-body">
                        {
                            order.payment ?
                            <p className="card-text">{order.payment.paymentMethod}</p>
                                : null
                        }
                    </div>
                </div>

                <div className="card mt-4 mb-4">
                    <div className="card-header">
                        Order items
                    </div>
                    <div className="card-body">
                        <table className="table text-center">
                            <thead style={{border: "none"}}>
                            <tr>
                                <th style={{border: "none"}} scope="col"></th>
                                <th style={{border: "none"}} scope="col">Name</th>
                                <th style={{border: "none"}} scope="col">Price</th>
                                <th style={{border: "none"}} scope="col">Qty</th>
                                <th style={{border: "none"}} scope="col">Subtotal</th>
                                <th style={{border: "none"}} scope="col"></th>
                            </tr>
                            </thead>
                            {
                                itemsHtml > 0?
                                    <tbody>
                                        {/*<tr className="text-center">*/}
                                        {/*    <th className="text-center" scope="row" colSpan="6">qwe</th>*/}
                                        {/*</tr>*/}
                                    {itemsHtml}
                                    </tbody>
                                    :
                                    <tbody>
                                    <tr className="text-center">
                                        <th className="text-center" scope="row" colSpan="6">Your cart is empty. </th>
                                    </tr>
                                    </tbody>
                            }
                        </table>
                    </div>
                </div>
            </div>
        </div>
    </div>
}

export default OrderDetail
